Dangerous Games Illutionist Collectors Edition-Wendy99


::Information::


Year of release : 2015 
Genre : Quest, Hidden Object 
Developer : Blam! Games 
Publisher : Big Fish Games 
Platform : PC 
Language : English 
Voice set Language : English 
Tablet: Not Required


::Description::


Twenty years ago, Samuel Taylor organized the championship of illusionists 
at their hotel, but there was a tragedy the hotel caught fire, and the winner 
of the championship was lost in the fire.


::System Requirements::


* OS: Windows XP / Vista / 7/8 
* CPU: 2.0 GHz or faster Processor 
* RAM: 1024 MB or more 
* DirectX: 9.0 or better 
* HDD: 1.10 GB


::Collectors Edition Includes::


~ Bonus gameplay and built passage 
~ wallpaper and desktop wallpaper 
~ soundtrack and concept art


